import React, { useContext } from 'react';
import ConfProject from '../../contexts/ConfProject';
import Project from './Project';

import './style.scss';

function Comunity() {
  const { projects } = useContext(ConfProject);

  return (
    <main className="comunity">
      {projects.map(({ nome, descricao, color, project, language }) => {
        return <Project
          nome={nome}
          descricao={descricao}
          color={color}
          project={project}
          language={language}
        />
      })}
    </main>
  );
}

export default Comunity
